script: |
  super -f text -I q1796.spq | sort > q1796.out

inputs:
  - name: q1796.spq
    data: |
      SELECT d-e,
      c-d
      FROM t1 (FORMAT parquet)
      WHERE (e>c OR e<d)
      AND d NOT BETWEEN 110 AND 150;
  - name: t1

outputs:
  - name: q1796.out
    data: |
      -1	-1
      -1	-1
      -1	-1
      -1	-2
      -2	-2
      -2	1
      -4	2
      1	-
      1	2
      2	-1
      2	-3
      2	2
      3	-2
      3	1
